import styles from "./Register.module.css";
import { Link } from "react-router-dom";
import { useState } from "react";
import Navbar from "../../components/Navbar/Navbar";
import logoAdd from "../../assets/icons/person_add_black_24dp (1).svg";
import logoReset from "../../assets/icons/baseline-refresh-24px.svg";
import logoSave from "../../assets/icons/baseline-save-24px.svg";

const Register = () => {
  const [user, setUser] = useState("");
  const [name, setName] = useState("");
  const [company, setCompany] = useState("");
  const [cnpj, setCnpj] = useState("");

  const formatCnpj = (value) => {
    const formattedCnpj = value
      .replace(/\D/g, "")
      .replace(/(\d{2})(\d)/, "$1.$2")
      .replace(/(\d{3})(\d)/, "$1.$2")
      .replace(/(\d{3})(\d)/, "$1/$2")
      .replace(/(\d{4})(\d)/, "$1-$2")
      .slice(0, 18);

    setCnpj(formattedCnpj);
  };

  const handleRegister = async () => {
    try {
      const response = await fetch("http://localhost:3000/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Origin: "http://localhost:3001/register",
        },
        body: JSON.stringify({
          user,
          name,
          company,
          cnpj,
        }),
      });

      if (response.ok) {
        console.log(response);
        console.log("Usuário registrado com sucesso!");
      }

      throw new Error("Erro ao registrar usuário");
    } catch (error) {
      console.error("Erro ao registrar usuário:", error.message);
    }
    setName("");
    setUser("");
    setCompany("");
    setCnpj("");
  };
  return (
    <div className={styles.container}>
      <Navbar />
      <div className={styles.infoRectangle}>
        <h1 className={styles.titleAdd}>
          <img src={logoAdd} alt="logoAdd" className={styles.logoAdd} />
          CADASTRAR UM NOVO USUÁRIO
        </h1>
        <div className={styles.containerInput}>
          <div>
            <label>USUÁRIO</label>
            <input
              type="text"
              className={styles.inputStyles}
              onChange={(e) => setUser(e.target.value)}
            />
          </div>
          <div>
            <label>NOME</label>
            <input
              type="text"
              className={styles.inputStyles}
              onChange={(e) => setName(e.target.value)}
            />
          </div>
          <div>
            <label>EMPRESA</label>
            <input
              type="text"
              className={styles.inputStyles}
              onChange={(e) => setCompany(e.target.value)}
            />
          </div>
          <div>
            <label>CNPJ</label>
            <input
              type="text"
              className={styles.inputStyles}
              onChange={(e) => formatCnpj(e.target.value)}
            />
          </div>
        </div>
      </div>
      <div className={styles.containerRemove}>
        <div className={styles.quadradoCinza}>
          <img
            className={styles.logoRemove}
            src={logoReset}
            alt="ImagLogoRemove"
          />
        </div>
        <Link className={styles.linkRetangularCinza} to="/register">
          RESETAR SENHA
        </Link>
      </div>
      <div className={styles.containerAdd}>
        <div className={styles.quadradoAzul}>
          <img className={styles.logoCad} src={logoSave} alt="ImagLogoAddem" />
        </div>
        <button className={styles.linkRetangular} onClick={handleRegister}>
          SALVAR ALTERAÇÕES
        </button>
      </div>
    </div>
  );
};

export default Register;
